import * as React from 'react';
import PropTypes from 'prop-types';
import AppBar from '@mui/material/AppBar';
import Grid from '@mui/material/Grid';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import Toolbar from '@mui/material/Toolbar';
import building from '../../Asserts/Logos/building.png'



function Header(props) {
  const { onDrawerToggle } = props;

  return (
    <React.Fragment>
      <AppBar  sx={{ backgroundColor:'#f3ecb059',
    boxShadow:'0 8px 32px rgba(31,28,135,0.37) ',
    backdropFilter:' blur(8.5px)',
    borderRadius:'10px'}} position="relative" elevation={4}>
        <Toolbar>
          <Grid container spacing={1} alignItems="center">


            <Grid sx={{ display: { sm: 'none', xs: 'block' } }} item>
              <IconButton
                color="inherit"
                aria-label="open drawer"
                onClick={onDrawerToggle}
                edge="start"
              >
                <MenuIcon />
              </IconButton>
            </Grid>

            <Grid>
              <img src={building} alt="building" className="h-20  object-cover border-4 border-gray-400"></img>
            </Grid>





          
          </Grid>
        </Toolbar>
      </AppBar>
   
    </React.Fragment>
  );
}

Header.propTypes = {
  onDrawerToggle: PropTypes.func.isRequired,
};

export default Header;
